import React from "react";
import "../style.css";
import "./Icon_data";
import icon_data from "./Icon_data";
const Nav2 = () => {
  return (
    <div>
      <div class="scrolling-wrapper">
        <div className="icon">
          {icon_data.map((e) => (
            <div style={{display:"flex",flexDirection:"column",alignItems:""}} key={e.id}>
              <img src={e.image} alt={e.title} />
              <>{e.title}</>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Nav2;
